  salinity and other variables collected from discrete sample and profile observations
  using CTD, bottle and other instruments from the TYRO in the North Atlantic Ocean
  from 1989-07-31 to 1989-09-11 (NODC Accession 0113604)\",\n\t\"tracking_summary\":
